import React from 'react';
import MultiBarGraph from './MultiBarGraph'; // Adjust the path

const App = () => {
  const dataTables1 = [
    [
      { date: '2023-08-01', remediation: 'A', totalInvocations: 50 },
      { date: '2023-08-02', remediation: 'A', totalInvocations: 65 },
      // ... other rows ...
    ],
    [
      { date: '2023-08-01', remediation: 'B', totalInvocations: 30 },
      { date: '2023-08-02', remediation: 'B', totalInvocations: 45 },
      // ... other rows ...
    ],
  ];

  const dataTables2 = [
    [
      { date: '2023-08-01', remediation: 'X', totalInvocations: 80 },
      { date: '2023-08-02', remediation: 'X', totalInvocations: 95 },
      // ... other rows ...
    ],
    [
      { date: '2023-08-01', remediation: 'Y', totalInvocations: 60 },
      { date: '2023-08-02', remediation: 'Y', totalInvocations: 75 },
      // ... other rows ...
    ],
  ];

  return (
    <>
    <script src="http://localhost:8097"></script>
    <div>
      <h1>Multi Bar Graph Example</h1>
      <h2>Data Tables 1</h2>
      <MultiBarGraph dataTables={dataTables1} />
      <h2>Data Tables 2</h2>
      <MultiBarGraph dataTables={dataTables2} />
    </div>
    </>

  );
};

export default App;
